var worldcity = require('./../data/result.js');
var index = 0;
module.exports = function () {
  index++;
  var i = 0;
  var result = [];
  for (var k in worldcity) {
    var obj = worldcity[k];
    obj.id = k;
    obj.value = Math.cos(i++ + index / 1200); //00000
    if (obj.value > 0.1) {
      result.push(obj);
    }
  }
  return result;
};